import React, { useEffect, useState } from 'react';
import axios from 'axios';

function DataDisplay() {
  const [data, setData] = useState([]);
  const [isLoading, setIsLoading] = useState(true);

  useEffect(() => {
    // Replace 'API_URL' with the actual URL of the API you want to fetch data from.
    const apiUrl = 'http://localhost:8000/api/countrydata/';

    axios.get(apiUrl)
      .then((response) => {
        setData(response.data);
        setIsLoading(false);
      })
      .catch((error) => {
        console.error('Error fetching data:', error);
        setIsLoading(false);
      });
  }, []);

  if (isLoading) {
    return <div>Loading...</div>;
  }

  return (
    <div>
      <h1>JSON Data from API</h1>
      {data.map((item) => (
        <table key={item.id}>
          <thead>
            <tr>
              <th>Country Name</th>
              <th>Country Code</th>
              <th>Indicator Name</th>
              <th>Indicator Code</th>
              {Object.keys(item.YearlyData).map((year) => (
                <th key={year}>{year}</th>
              ))}
            </tr>
          </thead>
          <tbody>
            <tr>
              <td>{item.CountryName}</td>
              <td>{item.CountryCode}</td>
              <td>{item.IndicatorName}</td>
              <td>{item.IndicatorCode}</td>
              {Object.values(item.YearlyData).map((value, index) => (
                <td key={index}>{value}</td>
              ))}
            </tr>
          </tbody>
        </table>
      ))}
    </div>
  );
}

export default DataDisplay;
